import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // Ensure this path is correct
import Home from './components/Home'; // Ensure this path is correct
import About from './components/About'; // Ensure this path is correct
import Contact from './components/Contact'; // Ensure this path is correct
import Login from './components/Login'; // Ensure this path is correct
import Register from './components/Register'; // Ensure this path is correct
import Dashboard from './components/Dashboard'; // Ensure this path is correct
import DoctorList from './components/sections/DoctorList'; // Ensure this path is correct
import AppointmentList from './components/sections/AppointmentList'; // Ensure this path is correct
import AvailabilityDates from './components/sections/AvailabilityDates'; // Ensure this path is correct
import PatientList from './components/sections/PatientList'; // Ensure this path is correct
import FeedbackList from './components/sections/FeedbackList'; // Ensure this path is correct
import Doctordashboard from './components/Doctordashboard'; // Ensure this path is correct
import PatientDashboard from './components/PatientDashboard'; // Ensure this path is correct
import UserList from './components/sections/UserList'; // Ensure this path is correct
import AdminList from './components/sections/AdminList'; // Ensure this path is correct

function App() {
  // State to hold doctor data
  const [doctors, setDoctors] = useState([]);

  // Function to add a new doctor to the list
  const addDoctor = (doctor) => {
    setDoctors((prevDoctors) => [...prevDoctors, doctor]);
  };

  return (
    <Router>
      <Navbar />
      <div className="content">
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Dashboard Routes */}
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/Doctordashboard" element={<Doctordashboard />} />
          <Route path="/PatientDashboard" element={<PatientDashboard />} />

          {/* Section Routes */}
          <Route path="/doctorlist" element={<DoctorList doctors={doctors} />} />
          <Route path="/appointmentlist" element={<AppointmentList />} />
          <Route path="/availabilitydates" element={<AvailabilityDates />} />
          <Route path="/patientlist" element={<PatientList />} />
          <Route path="/feedbacklist" element={<FeedbackList />} />
          <Route path="/userlist" element={<UserList />} />
          <Route path="/adminlist" element={<AdminList />} />

          {/* Catch-All Route */}
          <Route path="*" element={<div>Page Not Found</div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
